function App() {

    const [data, setData] = useState([{}])

    useEffect(() => {
        fetch("/users").then(
            res => res.json()
        ).then(
            data => {
                setData(data),
                console.log(data)
            }
        )
    }, [])
    return (
      <div>
        <span>
          {data}
        </span>
        </div>
    )
}

export default App;
